import React,{useState} from 'react';
import { Button, StyleSheet, Text, View, TextInput, ScrollView } from 'react-native';

export default function App() {
  const [people, setPeople] = useState([
    {name:'shaun', key:'1'},
    {name:'ally', key:'2'},
    {name:'munir', key:'3'},
    {name:'ren', key:'4'},
    {name:'kar', key:'5'},
    {name:'shir', key:'6'},
  ]);

  return (
    <View style={styles.container}>
    <ScrollView>
    {people.map((item) => {
      return (
        <View key={item.key}>
          <Text style={styles.text}>{item.key}: {item.name}</Text>
        </View>
      )
    })}      
    </ScrollView>
    </View>
  ); 
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  textinputter: {
    borderWidth:2,
    borderColor: '#777',
    padding: 8,
    margin: 10,

  },
  input:{
    color: 'grey',
    fontSize: 20,
  },
  text: {
    marginTop: 24,
    padding: 30,
    backgroundColor: 'pink',
  }
});
